import React from 'react'
import './NavBar.scss';

function NavBar() {
  return (
    <ul>
        <li>
            <link to="/">Accueil</link>
        </li>
        <li>
            <link to="/Ecrire">Ecrire</link>
        </li>
        <li>
            <link to="/Contact">Contact</link>
        </li>
    </ul>
  );
}

export default App;
